export default function Electricos() {
    return (
        <div>
            <Head />
            <Body />
            <Footer />
        </div>
    )
}


function Body() {

    // useEffect(() => {
    //     const script = document.createElement("script");

    //     script.src = "./plugins/Isotope/isotope.pkgd.min.js";
    //     script.async = true;

    //     document.body.appendChild(script);

    // }, [])

    return (
        <div className="new_arrivals">
            <div className="container">
                <div className="row">
                    <div className="col text-center">
                        <div className="section_title new_arrivals_title">
                            <h2>New Arrivals</h2>
                        </div>
                    </div>
                </div>
                <div className="row align-items-center">
                    <div className="col text-center">
                        <div className="new_arrivals_sorting">
                            <ul className="arrivals_grid_sorting clearfix button-group filters-button-group">
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center active is-checked"
                                    data-filter="*">TODOS</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".women">Arrancadores suaves</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".accessories">Contactores</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".men">Convertidores de frecuencia</li>

                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".men">Guardamotor</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".men">Interruptores</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".men">Motores</li>
                                <li className="grid_sorting_button button d-flex flex-column justify-content-center align-items-center"
                                    data-filter=".men">PLC</li>
                            </ul>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col">

                    </div>
                </div>
            </div>

        </div>
    )
}


function TestCard() {

